// import '../scss/layouts/header.scss'
import Logo from '../public/images/houzz_logo.svg';


const Header = () => {
    return (
        <header id="Header">
            <style>
                {`
                    #Header .container{
                        height: 100%;
                        display:flex;
                        align-items:center;
                    }
                    #Header .logo{
                        width: 140px
                        height:60px;
                    }
                `}
            </style>

           <div className="container">
                <a className="logo">

                </a>
                <Logo style={{width:'114px'}}/>
           </div>
        </header>
    )
}

export default Header;
